INSERT INTO `faq` (`id`, `qus`, `ans`, `type`) VALUES
(15, 'What is a B2B portal?', 'A B2B portal is an online platform where businesses can connect with suppliers, place orders, manage transactions, and access various services. Our portal is designed to streamline your procurement process and enhance your business operations.', 0),
(16, 'How do I access the B2B portal?', 'You can access the portal by visiting [https://growindiaexport.com/] and logging in with your credentials. If you don’t have an account, you can request access by [contacting our support team/using the registration link].', 0),
(17, 'How do I create an account?', ' To create an account, click on the “Register” button on the portal’s homepage and complete the registration form. You will receive a confirmation email once your account is activated.', 0),
(18, 'How do I search for products?', ' Use the search bar on the portal’s homepage to enter keywords, or categories. You can also browse through product categories or use advanced filters to refine your search.', 0),
(19, 'What payment methods are accepted on the portal?', 'We accept [list payment methods, e.g., credit/debit cards, bank transfers ]. For detailed information on payment options, please refer to our payment policy.', 0),
(20, 'How do I contact customer support?', 'You can contact customer support via [email, phone, live chat] available on the portal. Our support team is available [hours of operation] to assist you with any issues or questions.', 0),
(21, 'How do I provide feedback or report a problem? ', 'You can provide feedback or report problems through the “Feedback” form available on the portal or by contacting our support team directly.', 0),
(22, 'What details are required for registration on growindiaexport.com ?', 'To successfully register on growindiaexport.com, you need:  Email id Mobile number Company Name Company Address At least 1 Product/Service Country name', 1),
(23, '1. How do I register as a seller on growindiaexport.com?', 'To become a seller, visit our registration page and complete the application form. You’ll need to provide details about your business, including your company name, contact information, and business license. Once submitted, our team will review your page and you will be automatically added to the portal.', 1),
(24, 'What documentation is required to register?', 'You will need to provide a valid business license, tax identification number, and any other relevant documentation as requested during the registration process. This helps us verify your business and ensure compliance with our policies.', 1),
(25, ' What are the fees associated with selling on the portal?', 'There are different plans associated with the services.You can purchase any service by following the payment process.', 1),
(30, 'Where can we find buyer sources?', ' <b>Trade Shows,Google Ads,Social Media Marketing,Online Trade Shows</b>', 1);
