INSERT INTO `news` (`id`, `slug`, `image`, `heading`, `short_para`, `long_para`, `date`, `about_image`) VALUES
(11, '', 'news/1.jpg', 'Govt said to raise import taxes on vegetable oils to help farmers', 'Details of the Tax Increase: The news would likely include specifics about how much the import taxes on vegetable oils are being raised. It might detail the percentage increase and how it compares to previous rates.', 'Details of the Tax Increase: The news would likely include specifics about how much the import taxes on vegetable oils are being raised. It might detail the percentage increase and how it compares to previous rates.\r\n\r\nGovernment Rationale: The announcement would explain the reasoning behind the tax hike. This typically includes aims like supporting local farmers, reducing the import bill, and boosting domestic production.\r\n\r\nImpact on Farmers: Coverage would include how the tax increase is expected to benefit local farmers. This might involve potential increases in their income or market share.\r\n\r\nConsumer Impact: The news would also address how the tax increase could affect consumers, such as potential higher prices for vegetable oil products.\r\n\r\nIndustry Reactions: Reactions from various stakeholders, including farmers, importers, and industry associations, would be covered. This could include both support and criticism of the policy.\r\n\r\nEconomic and Trade Considerations: There might be discussion about how this policy fits into broader economic and trade strategies, and its potential implications for international trade relations.', '2024-09-02', 'Vegetable Oil'),
(12, '', 'news/i.jpg', ' Government notifies 160 tons of gold import from UAE at concessional rate this fiscal under trade pact', 'Details of the Import: The news would specify the amount of gold (160 tons) and the duration over which it will be imported under the concessional rate.', 'Details of the Import: The news would specify the amount of gold (160 tons) and the duration over which it will be imported under the concessional rate. It would also outline the specifics of the trade pact with the UAE that makes this possible.\r\n\r\nConcessional Rate: The news would detail what the concessional rate is and how it compares to standard import duties. This could include information on the financial benefits of this rate for the importing country.\r\n\r\nPurpose of the Import: The notification might explain why such a large quantity of gold is being imported. This could relate to meeting domestic demand, supporting reserves, or other economic objectives.\r\n\r\nEconomic and Trade Implications: The report would likely discuss how this import affects the local gold market, trade relations with the UAE, and broader economic impacts. It might explore how it influences gold prices domestically and any effects on local gold mining industries.\r\n\r\nGovernment and Industry Reactions: Reactions from various stakeholders, including government officials, industry leaders, and economists, would be covered. This could include the perceived benefits of the trade pact and any concerns or criticisms.\r\n\r\nFuture Outlook: There might be commentary on what this development means for future trade relations and gold imports, as well as any potential changes in policy or trade agreements.', '2024-09-02', 'Gold '),
(13, '', 'news/Meghalaya.jpg', ' The Solvent Extractors Association of India has asked the government to revisit its ban on de-oiled rice bran exports, pointing to severe underutilisation of processing plants in eastern India.', 'Details of the Ban: The news would specify the nature of the ban on de-oiled rice bran exports, including its scope and duration. It would explain how long the ban has been in place and how the extension affects exporters.\r\n', 'SEA\'s Concerns: The Solvent Extractors’ Association’s (SEA) reasons for opposing the extension would be highlighted. This could include concerns about the negative impact on exporters, the financial strain on businesses, and potential disruptions in international trade.\r\n\r\nEconomic Impact: The news would likely address the broader economic implications of the ban extension. This could include how it affects the domestic rice bran processing industry, employment, and revenue from exports.\r\n\r\nGovernment\'s Rationale: The article might provide insights into why the government decided to extend the ban. This could involve reasons such as ensuring sufficient domestic supply, controlling prices, or other policy objectives.\r\n\r\nReactions from Stakeholders: Coverage would include reactions from other industry stakeholders, including farmers, exporters, and trade associations. This might feature both support for and criticism of the government\'s decision.\r\n\r\nPotential Outcomes: The news might speculate on possible outcomes if the government does or does not reconsider the extension, including potential changes in policy or trade dynamics.\r\n\r\nCall to Action: The SEA’s specific requests or proposals for how the government could address their concerns would be highlighted..\r\n', '2024-09-02', 'ASASAS'),
(15, '', 'news/russia.jpg', 'Invest in Russia,Invest in India ', 'Lesser-known examples of existing Indian business projects in .................', 'It is well-known that in recent years India has made substantial progress in Ease of Doing Business rankings and, importantly, in letting the world know about its investment opportunities. Under the influence of global trends and a combination of internal difficulties the volume of FDI in India has been on decline lately, presenting a concern to India’s economists and government officials. The long-term trend, however, is positive.\r\n\r\nsourcevia @economictimes', '2024-09-04', 'India - Russia'),
(17, '', 'news/JAI.JPG', 'India open to do business with China, but terms must be looked into: EAM S Jaishankar', 'India&#039;s External Affairs Minister, S. Jaishankar, has indicated that while India is open to engaging in business with China....', 'India&#039;s External Affairs Minister, S. Jaishankar, has indicated that while India is open to engaging in business with China, it’s crucial to carefully consider the terms of such engagements. This reflects a nuanced approach where India is willing to explore economic opportunities but insists on ensuring that these terms are equitable and address any concerns related to strategic and national interests.\r\n\r\nJaishankar&#039;s stance underscores the importance of balancing economic cooperation with national security and strategic considerations, especially given the complex geopolitical relationship between the two countries.', '2024-09-11', 'EAM S Jaishankar'),
(22, '', 'news/INJA.JPG', 'India and Japan have agreed to deepen their financial cooperation and strengthen their bilateral ties.', 'India and Japan have agreed to deepen their financial cooperation and strengthen their bilateral ties. This move reflects their commitment to enhancing economic and strategic partnerships.....', 'India and Japan have agreed to deepen their financial cooperation and strengthen their bilateral ties. This move reflects their commitment to enhancing economic and strategic partnerships. The agreement likely encompasses various areas such as trade, investment, infrastructure development, and technological collaboration.\r\n\r\nJapan has been a significant partner for India in areas like infrastructure and development projects. Both nations are also looking to bolster their economic ties in the face of regional and global challenges, potentially leveraging their cooperation to address broader geopolitical and economic issues.\r\n\r\nThis enhanced cooperation is expected to benefit both countries by promoting economic growth, increasing investment opportunities, and fostering greater collaboration in key sectors.', '2024-09-11', 'India-Japan'),
(33, '', 'news/agro.jpg', 'Agrochemicals export likely to touch Rs 80,000 cr in 4 yrs: ACFI-EY report', 'According to a report by the Agro Chemicals Federation of India (ACFI) and EY, India&#039;s agrochemical exports are projected to reach ₹80,000 crore (₹800 billion) over the next four years...', 'According to a report by the Agro Chemicals Federation of India (ACFI) and EY, India&#039;s agrochemical exports are projected to reach ₹80,000 crore (₹800 billion) over the next four years. This optimistic forecast reflects the growing global demand for agrochemical products and India&#039;s expanding role in the international agrochemical market.\r\n\r\nSeveral factors contribute to this positive outlook, including advancements in agricultural technology, increased adoption of agrochemicals in various regions, and the strengthening of India&#039;s manufacturing capabilities. The report suggests that India&#039;s competitive advantage in terms of production costs and expertise in agrochemical formulations positions it well to capitalize on these opportunities.', '2024-09-11', 'ACFI'),
(35, '', 'news/india-mal.jpg', 'India adds two more ports for export of essential commodities to Maldives', '', 'India’s recent move to add two more ports for exporting essential commodities to the Maldives is a significant step in strengthening trade relations and ensuring a steady supply of vital goods to the island nation. This decision likely reflects a broader strategy to enhance regional cooperation and support the Maldives&#039; needs.\r\n\r\nThe addition of these ports can facilitate smoother and more efficient trade logistics, potentially reducing costs and improving delivery times for essential goods such as food, medicine, and other supplies. It also underscores India&#039;s commitment to maintaining a strong partnership with the Maldives, which is crucial for regional stability and economic development.', '2024-09-11', 'India-Maldives'),
(36, '', 'news/mald.jpg', 'India set to review trade pact with Malaysia as deficit grows .', '', 'The trade pact in question, which aims to enhance bilateral trade and economic cooperation, is now under scrutiny to ensure it aligns with India&#039;s economic interests and trade goals. This review could lead to renegotiations or adjustments to address the imbalance and improve trade relations.\r\n\r\nKey factors influencing this review include:\r\n\r\nEconomic Imbalance: India&#039;s growing trade deficit with Malaysia highlights the need to evaluate the terms of the agreement to ensure a fair and balanced trade relationship.\r\n\r\nStrategic Interests: Both countries have strategic interests in maintaining strong economic ties, but adjustments may be necessary to reflect current economic realities.\r\n\r\nSectoral Concerns: Specific sectors or industries may be disproportionately affected, prompting targeted adjustments to the trade pact.\r\n\r\nPolicy Shifts: Changes in domestic economic policies or global trade dynamics could also influence the decision to reassess the agreement.', '2024-09-12', 'India-Maldives'),
(37, '', 'news/monkey.jpg', 'Monkey pox In Africa- A major concern for exporters.', '', '(1.)Trade Disruptions\r\n\r\nQuarantines and Restrictions: Outbreaks can lead to quarantine measures or trade restrictions. For example, countries may impose bans or additional controls on imports from affected regions, impacting the export of goods such as animals or animal products.\r\n\r\nLogistics Challenges: Travel restrictions and disruptions in transport routes can affect the timely delivery of goods and services, leading to delays and increased costs.\r\n\r\nMarket Perception\r\n\r\nConsumer Concerns: There may be concerns among international consumers about the safety of products from affected regions. This can affect demand and lead to negative perceptions about the safety of imports.\r\n\r\n(2) Reputational Risk: Exporters may face reputational damage if there are fears that their products are linked to disease outbreaks, even if there is no direct connection.', '2024-09-12', 'Monkey Pox in Africa'),
(38, '', 'news/growth.jpg', 'India can become $10 tn economy by 2032; beat US, China in manufacturing: Report', '', 'India has the potential to become a $10 trillion economy by 2032, driven by robust growth in manufacturing, digitalization, and infrastructure development. A report suggests that with strategic investments and policy support, India could outperform both the US and China in manufacturing sectors. Key areas of focus include enhancing supply chains, fostering innovation, and improving ease of doing business. By leveraging its demographic advantage and expanding exports, India could position itself as a global manufacturing hub. This growth trajectory could significantly boost employment and overall economic stability.', '2024-09-23', 'Indian Growth'),
(39, '', 'news/676.jpg', 'Piyush Goyal unveils two portals to resolve exporters&#039; issues, bring transparency news', '', 'Piyush Goyal has recently unveiled two new portals aimed at resolving issues faced by exporters and enhancing transparency in the export process. These platforms will facilitate better communication between exporters and government departments, allowing for quicker resolution of concerns related to documentation, compliance, and logistics. \r\nThe initiative is designed to improve the ease of doing business in India, boost exporter confidence, and streamline the overall export process. This move aligns with the government&#039;s broader goals of strengthening India&#039;s global trade position and supporting the manufacturing sector.', '2024-09-23', 'Portals for Export'),
(40, '', 'news/export.jpg', 'FIEO Urges Government to Extend Interest Subvention Scheme for 5 Years', '', 'The Federation of Indian Export Organisations (FIEO) has called on the government to extend the interest subvention scheme for an additional five years. This extension is seen as crucial for supporting exporters, especially in light of global economic uncertainties. The scheme has been instrumental in reducing the cost of borrowing for exporters, helping them remain competitive in international markets. FIEO emphasizes that continued financial support will enable exporters to sustain growth and navigate challenges effectively.', '2024-09-25', 'FIEO Planning'),
(41, '', 'news/hilsa.jpg', 'Bangladesh Reverses Hilsa Export Ban; Approves 3,000-Tonne Shipment to India Ahead of Durga Puja', '', 'In a significant development, the Bangladeshi government has lifted its ban on Hilsa fish exports, approving a shipment of 3,000 tonnes to India just in time for the Durga Puja celebrations.\r\n\r\nKey Highlights:\r\nExport Ban Reversal: The reversal of the export ban comes as a welcome relief to Indian consumers, especially given the cultural significance of Hilsa during the festive season.\r\n\r\nCultural Ties: Hilsa fish, known for its unique flavor, is a delicacy enjoyed during Durga Puja, and this decision is expected to strengthen the ties between India and Bangladesh.\r\n\r\nEconomic Considerations: The export of Hilsa is not only important for culinary traditions but also has economic implications for Bangladeshi fishermen and exporters.\r\n\r\nGovernment Statement: Officials stated that the decision was made considering both the cultural significance of the festival and the economic benefits of trade between the two countries.\r\n\r\nThis move is anticipated to enhance bilateral relations while catering to the demand for Hilsa fish in India during one of its most celebrated festivals.', '2024-09-25', 'Hilsa Fish'),
(42, '', 'news/ind-chi.jpg', 'Indian steelmakers seek higher tariffs as Chinese imports surge', '', 'Indian steelmakers are pushing for higher tariffs in response to a significant surge in Chinese steel imports. They argue that increased tariffs are necessary to protect the domestic industry from unfair competition and to ensure sustainable growth. The influx of cheaper Chinese steel has raised concerns about potential market disruptions and pricing pressures.\r\n\r\nSteel producers in India are advocating for policy changes to create a more level playing field, as they face challenges such as rising production costs and fluctuating demand. This situation highlights ongoing tensions in the global steel market, where various countries are grappling with the impacts of imports on local industries.\r\n\r\nThe Indian government is evaluating these requests as it balances trade relations and domestic economic interests.', '2024-09-27', 'India-China'),
(43, '', 'news/onion.jpg', 'Onion export duty slash: Mixed reactions in India’s largest onion producing State', '', 'The recent decision to slash onion export duties has sparked mixed reactions in Maharashtra, India’s largest onion-producing state. On one hand, farmers and exporters are optimistic, believing that reduced duties will enhance competitiveness in international markets and boost their earnings. They argue that this move could help alleviate the financial pressures faced by farmers due to fluctuating domestic prices.\r\n\r\nConversely, some stakeholders express concerns that the reduction might lead to higher prices domestically, impacting local consumers. Additionally, there are worries about how this will affect the supply chain and potential over-reliance on exports.\r\n\r\nOverall, while many see this as a positive step towards increasing exports and supporting farmers, others caution that careful monitoring is essential to ensure that domestic needs are not compromised.', '2024-09-30', 'Export Duty Slash'),
(44, '', 'news/k.jpg', 'Is the spike in India’s trade deficit a worry?', '', 'Economic Impact: A widening trade deficit often indicates that a country is importing more than it is exporting, which can lead to a negative balance of payments and potentially weaken the currency.\r\n\r\nInflationary Pressures: Increased imports, especially of essential goods like oil, can lead to higher prices domestically, contributing to inflation.\r\n\r\nDependence on Imports: A large trade deficit can signal over-reliance on foreign goods, which might affect local industries and employment.\r\n\r\nInvestment Sentiment: A persistent trade deficit may impact investor confidence, affecting foreign direct investment (FDI) and overall economic stability.\r\n\r\nPolicy Responses: Governments may need to implement measures to address trade imbalances, such as tariffs or trade agreements, which can have long-term economic consequences.', '2024-10-07', 'India'),
(45, '', 'news/make in india.jpg', 'Make in India needs a reset. It won&#039;t work unless we focus on exports', '', 'Quality and Standards: Ensuring that products meet international quality standards is crucial. Investing in technology and training can help improve production quality.\r\n\r\nMarket Access: Creating better trade agreements and partnerships can open new markets for Indian products. This includes reducing tariffs and facilitating smoother trade processes.\r\n\r\nSkill Development: Upskilling the workforce to meet global standards in various sectors, especially in technology and manufacturing, will help boost competitiveness.\r\n\r\nInfrastructure Improvement: Enhancing logistics and supply chain infrastructure can reduce costs and improve efficiency, making Indian products more attractive internationally.\r\n\r\nSupport for SMEs: Small and medium enterprises often drive exports. Providing them with the necessary support, such as financing and market access, can stimulate growth.\r\n\r\nInnovation and R&amp;D: Encouraging research and development can lead to new products that cater to global needs, giving Indian manufacturers a competitive edge.\r\n\r\nBranding and Promotion: Actively promoting Indian products on international platforms can help build a strong brand presence globally.', '2024-10-15', 'Make in India'),
(46, '', 'news/export.jpg', 'India’s Exports Rise 4.86% to $393.22 Billion from April to September', '', 'India&#039;s exports have seen a notable increase of 4.86%, reaching $393.22 billion from April to September. This growth highlights the country&#039;s resilience in global trade despite various economic challenges. Key sectors contributing to this rise likely include pharmaceuticals, textiles, and engineering goods, among others. The government’s initiatives to boost exports and improve trade relations may also be playing a significant role in this positive trend.', '2024-10-22', 'Export Rise'),
(47, '', 'news/tex.jpg', 'India&#039;s technical textile industry exports to cross $10 billion by 2030: Minister', '', 'India&#039;s technical textile industry is projected to see exports exceed $10 billion by 2030, according to a statement from the Minister. This growth is expected to be driven by increased global demand for innovative textile products used in various sectors, including automotive, healthcare, and construction. The Indian government is also focusing on enhancing production capabilities and encouraging investments to support this ambitious target. This strategic push aims to position India as a key player in the global technical textiles market.', '2024-10-26', 'Textile Industry'),
(48, '', 'news/INUS.jpg', 'India USA relation continue to grow beside regime.', '', '1. Strategic and Security Cooperation:\r\nDefense and Security: Both India and the U.S. view each other as key strategic partners in maintaining peace and stability in the Indo-Pacific region. They have deepened defense cooperation, including joint military exercises, defense sales, and partnerships in counterterrorism and cybersecurity.\r\nGeopolitical Alignment: Shared concerns over the rise of China have brought India and the U.S. closer. Both countries are increasingly aligning their foreign policies to ensure freedom of navigation, regional security, and a rules-based international order in the Indo-Pacific.\r\n2. Economic Ties:\r\nTrade and Investment: Bilateral trade between the U.S. and India has grown significantly, with both countries benefiting from increased commerce in areas such as technology, pharmaceuticals, energy, and services. India is one of the largest trade partners of the U.S. in the region, and the U.S. is a major investor in India.\r\nGlobal Supply Chains: India&#039;s role in global supply chains, especially in the technology sector, makes it a valuable partner for the U.S. India&#039;s booming tech industry, particularly its IT services, has further solidified economic ties.\r\n3. Cultural and People-to-People Connections:\r\nDiaspora Influence: The Indian-American community, one of the fastest-growing and most influential in the U.S., plays a crucial role in fostering ties between the two countries. Indian Americans are present in all walks of life, from business and academia to politics and entertainment, strengthening the social and cultural bonds.\r\nEducation and Innovation: Many Indian students study in the U.S., contributing to academic exchanges and fostering long-term connections between the two countries&#039; future leaders and innovators.\r\n4. Shared Values and Ideals:\r\nDemocracy and Rule of Law: Both India and the U.S. are democracies with a commitment to the rule of law, human rights, and individual freedoms. Despite occasional disagreements on specific issues, such as human rights or trade policies, the two countries share a fundamental understanding of democratic values.\r\nMultilateral Cooperation: India and the U.S. collaborate in a range of multilateral forums, such as the United Nations, G20, and the Quad (Quadrilateral Security Dialogue), where they work together on issues like climate change, global health, and international security.', '2024-11-18', 'India-Usa'),
(50, '', 'news/1756378802-articleshow.jpg', 'What Is a Tariff — And How Does It Impact Indian Exports?', '', '<p>📦 What Is a Tariff?</p>\r\n<p>A tariff is a tax that one country places on goods imported from another country. It makes foreign products more expensive in the domestic market. Governments often use tariffs to protect local industries from international competition or as a tool during trade disputes.</p>\r\n<p>For example, if the United States imposes a 50% tariff on Indian textiles, it means that when those goods arrive in the US, they become 50% more expensive due to the added tax. This can discourage American businesses and consumers from buying them.</p>\r\n<p>How Tariffs Affect Indian Exports</p>\r\n<p>Tariffs can seriously hurt India&rsquo;s export-based industries. Here\'s how:</p>\r\n<p>1. Higher Prices = Less Demand</p>\r\n<p>When US tariffs increase, Indian goods become more expensive for American buyers. This leads to fewer sales, especially in price-sensitive sectors like:</p>\r\n<p>Textiles and clothing</p>\r\n<p>Gems and jewellery</p>\r\n<p>Seafood</p>\r\n<p>Leather goods</p>\r\n<p>2. Factories Lose Orders</p>\r\n<p>With reduced demand, Indian factories may receive fewer international orders. Some manufacturers may be forced to slow production or lay off workers. For example, textile hubs like Tirupur, Surat, and Delhi often suffer first.</p>\r\n<p>3. Loss of Market Share</p>\r\n<p>Other countries with lower or no tariffs &mdash; such as Vietnam, Thailand, or Bangladesh &mdash; can take India&rsquo;s place in global supply chains. This puts long-term pressure on India&rsquo;s export businesses.</p>\r\n<p>4. Impact on Economy</p>\r\n<p>The US is India&rsquo;s largest export destination, accounting for a major portion of revenue. When tariffs disrupt that trade, it can:</p>\r\n<p>Reduce India&rsquo;s GDP growth</p>\r\n<p>Widen the trade deficit</p>\r\n<p>Lower foreign exchange earnings</p>\r\n<p>5. Strained Political Relations</p>\r\n<p>Tariffs can also create diplomatic tension. If one country feels unfairly targeted, it might respond with its own trade restrictions, or shift alliances (e.g., India strengthening ties with Russia or China).</p>\r\n<p>🔍 Example: Tariffs on Indian Oil-Linked Exports</p>\r\n<p>If the US imposes a 50% tariff because India buys oil from Russia, this is seen as a political message. But the economic impact is immediate:</p>\r\n<p>Indian exports become uncompetitive</p>\r\n<p>Exporters may struggle to stay profitable</p>\r\n<p>Sectors like pharmaceuticals, electronics, and engineering goods may face long-term disruptions</p>\r\n<p>🧾 Final Thoughts</p>\r\n<p>Tariffs may look like a tool to pressure countries, but they often backfire. In the case of India, high US tariffs could hurt both sides &mdash; damaging Indian industries while increasing prices for American consumers.</p>\r\n<p>To remain competitive, India may need to:</p>\r\n<p>Explore new markets</p>\r\n<p>Boost domestic consumption</p>\r\n<p>Strengthen regional trade partnerships</p>', '2025-08-28', 'U.S.,  President Donald Trump');
