(140, ' Plastic Floor Broom', '', 'extra_image/Plastic Floor Broom.jpg', '', '', '', '42.00 - 100.00', '1989', 'M/S MAHAVIR INDUSTRIES', 'extra_image/logo_122307.jpg', '<p>Usage : <b>Household, Commercial, Other</b></p>\r\n<p>Material : <b>Plastic</b></p>\r\n<p>Feature : <b>Durable</b></p>\r\n<p>Payment Terms : <b>Cash Advance (CA)</b></p>', '', '', '', 0, 'M/S MAHAVIR INDUSTRIES', 'Manufacturer', '336 Pieces', 'Plastic Bag ', 'Long Shelf Life ', 'Durable', '', '2024-08-31', 18, 30, 124, 69, '', 'NO', '09ADWPJ0720H1ZF', '', 'NO', 'Uttar Pradesh', 'H. No. 3 Maruti Enclave, Phase-1, Maruti Estate, Bodla Road, Agra, Uttar Pradesh, 282007, India', '<p>Established in 1989, M/S MAHAVIR INDUSTRIES has been a trusted name in the industry, delivering high-quality cleaning solutions for over three decades. We are committed to excellence and innovation in every product we offer, ensuring you receive the best in both performance and durability.</p>\r\n<p>Featured Product: Plastic Floor Broom</p>\r\n<p>Our Plastic Floor Broom is engineered to provide superior cleaning efficiency and durability. Designed for both residential and commercial use, this broom combines robust construction with user-friendly features to make your cleaning tasks easier and more effective. The high-quality plastic bristles are designed to sweep away dust and debris with ease, while the sturdy handle ensures comfortable use and long-lasting performance.</p>', 'India', 'INR / Piece', 'not-active'),
