(197, 'Bike Cover', '', 'extra_image/Bike Cover .jpg', '', '', '', 'Get Latest Price', '1979', 'HEMAL MAKESPACE CORPS', 'extra_image/hemal-enterprises-logo.jpg', '<p>Accepts only Domestic inquiries</p>\r\n<p>Material : <b>Other, Plastic</b></p>\r\n<p>Technique : <b>Other</b></p>\r\n<p>Layer : <b>Double</b></p>\r\n<p>Usage : <b>Vehicle cover, Other</b></p>', '', '', '', 0, 'Mr Hemal D Shah', 'Manufacturer', '10 Pieces', 'Plastic Bag', 'Long Life', 'Double Layer', '', '2024-09-09', 12, 43, 156, 83, '', 'NO', '27AANFH3158D1ZD', '', 'NO', 'Maharashtra', 'Shop No. 17, Mehta Compound, Hindustan Naka, Charkop, Kandivali (W), Mumbai, Maharashtra, 400067, India', '<p>At HEMAL MAKESPACE CORPS, we are dedicated to providing high-quality products that meet diverse needs across various industries. </p>\r\n<p>Our key offerings include:</p>\r\n<p>Bike & Scooter Covers: Durable and weather-resistant covers designed to protect your two-Wheelers from the elements and ensure their longevity.</p>\r\n<p>HDPE/Canvas Tarpaulins: Versatile and robust tarpaulins made from high-density polyethylene and canvas, ideal for a range of protective and covering applications.</p>\r\n<p>Argo Nets: Strong and reliable nets suitable for agricultural use, providing essential support and protection for your crops.</p>\r\n<p>LDPE Plastic: Flexible and resilient plastic products that cater to various industrial and commercial needs.</p>', 'India', '', '0'),
(198, 'Grip Cover', '', 'extra_image/gripcover.jpg', '', '', '', '14', '2001', 'LAL-G ACCESSORIES', 'extra_image/No logo.jpg', '<p>Product Type : <b>Grip Cover, Other</b></p>\r\n<p>Material : <b>Rubber</b></p>\r\n<p>Vehicle Type : <b>Two Wheeler</b></p>\r\n<p>Warranty : <b>No</b></p>', '', '', '', 0, 'Mr Dheeraj Dhawan', 'Manufacturer', '100 Pairs', 'Plastic Bag', 'Long Life', 'Rubber', '', '2024-09-09', 12, 43, 157, 83, '', 'NO', '07AIKPD7987M1ZG', '', 'NO', 'Delhi', 'B No 1469/24 Ground Floor, Naiwala, Karol Bagh, New Delhi, Delhi, 110005, India', '<p>At LAL-G ACCESSORIES, we are dedicated to providing premium motorcycle and bike accessories that enhance your riding experience.</p>\r\n<p> Our product lineup includes:</p>\r\n<p>Bike Rubber Grip Cover, Bike Leather Side Bag, Bike Rubber Lever Sleeve, Cable Helmet Lock, and much more products.</p>', 'India', 'INR / Pair', '0');
