(199, 'Glycerin Liquid', '', 'extra_image/liquid-glycerine.jpg', '', '', '', '36000.00', '1993', 'ARK CHEMICALS', 'extra_image/ark-chemicals-logo.jpg', '<p>Grade : <b>Pharmaceutical Grade</b></p>\r\n<p>Purity : <b>0.98</b></p>\r\n<p>Physical Form : <b>Liquid</b></p>\r\n<p>Product Type : <b>Glycerin Liquid</b></p>\r\n<p>Storage : <b>Room Temperature</b></p>', '', '', '', 0, 'Mr Apurva Khandelwal', 'exporter', '500 Pieces', 'Bottle', '1 year', 'Liquid', '', '2024-09-09', 19, 44, 158, 84, '', 'NO', '19AAEFA6217F1ZO', '', 'NO', 'West Bengal', 'Building No 13, 2nd Floor, Portuguese Church Street, Burrabazar, Kolkata, West Bengal, 700001, India', '<p>At ARK CHEMICALS, we specialize in a comprehensive range of high-quality chemical products tailored to meet diverse industrial and commercial needs.</p>\r\n<p>Our extensive product lineup includes:</p>\r\n<p>Chemicals Products, Sulphonate Products, Speciality Chemicals, Caustic Soda, Blue Acid, Boric Acid and many more. </p>', 'India', 'INR / Kilograms', '0'),
(200, 'Glass Reagent Bottle', '', 'extra_image/Glass Reagent Bottle.jpg', '', '', '', '200', '1972', 'SABAR SCIENTIFIC', 'extra_image/sabar.jpg', '<p>Colour : <b>Transparent</b></p>\r\n<p>Product Type : <b>Glass Reagent Bottle</b></p>\r\n<p>Usage : <b>Chemical Laboratory</b></p>\r\n<p>Material : <b>Glass</b></p>\r\n<p>Payment Terms : <b>Cheque, Cash in Advance (CID), Cash Advance (CA)</b></p>', '', '', '', 0, 'Mr Harish A. Bhise', 'exporter', '20 Pieces', 'Box', '1-2 Years', 'Transparent', '', '2024-09-09', 19, 44, 159, 84, '', 'NO', '24ADKPB8899B1ZF', '', 'NO', 'Gujarat', 'I-148/B, Phase-II, GIDC Estate, Vatva, Ahmedabad, Gujarat, 382445, India', '<p>At SABAR SCIENTIFIC, we are dedicated to providing top-quality laboratory equipment and supplies to meet the needs of scientific professionals and researchers.</p>\r\n<p>Our Featured Product:</p>\r\n<p>Glass Reagent Bottles: Precision-crafted glass bottles designed for safe and reliable storage of chemicals and reagents. Our bottles are made from high-quality glass to ensure durability and resistance to chemical interactions, making them ideal for use in laboratories and research facilities.</p>', 'India', 'INR / Piece', '0'),
(201, 'Iodine Crystals', '', 'extra_image/Iodine Crystals.jpg', '', '', '', '4600', '2018', 'LADLEADD', 'extra_image/logo_150565.jpg', '<p>Product Type : <b>Iodine</b></p>\r\n<p>Purity :  <b>92%</b></p>\r\n<p>Physical Form :  <b>Powder</b></p>\r\n<p>Solubility :  <b>Yes</b></p>', '', '', '', 0, 'Mr Jaydeep', 'exporter', '10 Unit', 'HDPE Bags', '5 Years', '92% Pure', '', '2024-09-09', 19, 44, 160, 85, '', 'NO', '27AABHJ9570K1ZS', '', 'NO', 'Maharashtra', 'Purushottam Kheraj Estate, Dr Rajendra Prasad Road, Mulund West, Near Gyan Sarita School, Mumbai, Maharashtra, 400080, India', '<p>At LADLEADD, we specialize in providing high-quality chemical solutions for various industrial applications.</p>\r\n<p>Our product range includes:</p>\r\n<p>Lead Nitrate, Sodium Sulphate Anhydrous, Grain Refiners, Sodium Cryolite, etc.</p>', 'India', 'INR / Unit', '0'),
(202, 'Potassium Iodide', '', 'product-image/Potassium_iodide.jpg', '', '', '', '100.00', '1992', 'HALOGENS', 'extra_image/Halogens.jpg', '<p>Grade : <b>Medicine Grade</b></p>\r\n<p>Purity : <b>High</b></p>\r\n<p>Application : <b>Pharmaceutical Industry</b></p>\r\n<p>Colour : <b>White</b></p>\r\n<p>Form : <b>Powder</b></p>', '', '', '', 0, 'Mr. Dhamelia Govindbhai Balabhai', 'exporter', '1 Kilograms', 'Hdpe Bag', '5-7 Years', 'Powder', '', '2024-09-10', 19, 44, 161, 85, '', 'NO', '24AAAFH9119B1ZV', '', 'NO', 'Gujarat', 'Block No. 511, Nr. Lasundra Stand, Savli Road, Tundav, Tal. Savli, Vadodara, Gujarat, 391775, India', '<p>At HALOGENS, we specialize in providing top-notch chemicals to meet your needs.</p>\r\n<p>Our Products:</p>\r\n<p>High quality Laboratory Chemicals, Bulk Drugs, Pharmaceuticals Chemical, Mineral Fortifiers and Side Chain Chemical.</p>', 'India', 'INR / Kilograms', 'not-active'),
(203, 'Dried Kabuli Chana', '', 'extra_image/Dried Kabuli Chana Dried Kabuli Chana .jpg', '', '', '', 'Get Latest Price', '1961', 'RATNARAJ FOODS', 'extra_image/ratnaraj-foods-logo.jpg', '<p>Pulse Style : <b>Dried</b></p>\r\n<p>Type : <b>Chickpeas</b></p>\r\n<p>Cultivation Type : <b>Common</b></p>\r\n<p>Physical Form : <b>Whole</b></p>', '', '', '', 0, 'Mr Deep Girishbhai Shah', 'exporter', '500 Kilograms', 'Plastic Bag', '1 year', 'White', '', '2024-09-10', 16, 19, 65, 44, '', 'NO', '24ENJPS1690Q1Z4', '', 'NO', 'Gujarat', 'Survey No. 258, Block No. 515, G/F, Near Silver Estate, Rakanpur- Santej Road, Gandhinagar, Ahmedabad, Gujarat, 382721, India', '<p>At RATNARAJ FOODS, we take pride in offering a selection of premium food products that cater to your culinary needs. </p>\r\n<p>Our offerings include:</p>\r\n<p>Dried Kabuli Chana: Perfect for a variety of dishes, our dried Kabuli Chana is known for its superior taste and texture.</p>\r\n<p>Farm Fresh Chickpea: Sourced directly from farms, our chickpeas are fresh, nutritious, and ideal for your cooking.</p>\r\n<p>Fox Nuts (FULL Makhana): Enjoy the crispy and healthy snack of our full Makhana, a great choice for a wholesome treat.</p>', 'India', '', '0'),
(204, 'Paint Additive', '', 'extra_image/whiteliquide.jpg', '', '', '', '102', '1996', 'HARMONY ADDITIVES PRIVATE LIMITED', 'extra_image/harmony-additive logo.jpg', '<p>Brand Name : <b>HARMONY</b></p>\r\n<p>Application : <b>Industrial</b></p>\r\n<p>Grade : <b>Reagent Grade</b></p>\r\n<p>Physical Form : <b>Liquid</b></p>\r\n<p>Ph Level : <b>7 +/- 0.5</b></p>\r\n<p>Appearance : <b>Other, Milky White viscous liquid</b></p>', '', '', '', 0, 'Mr Rajesh Anand', 'exporter', '20', 'Box', 'Long Life', 'Liquid', '', '2024-09-10', 19, 45, 162, 86, '', 'NO', '24AACCH0071R1ZH', '', 'NO', 'Gujarat', 'PLOT NO. 41 HECTOR 52 , EXPANSION AREA NEW GIDC., Umbergaon, Gujarat, 396171, India', '<p>At HARMONY ADDITIVES PRIVATE LIMITED, we specialize in providing top-quality additives and chemicals designed to enhance your processes and products.</p>\r\n<p>Our comprehensive range includes:</p>\r\n<p> Anti Settling Agent, Wetting Agent, \r\n Thickeners, Dispersing Agents, Waste Water Treatment Chemicals etc. </p>', 'India', 'INR', '0'),
(205, 'Dye chemicals', '', 'extra_image/yellow.jpg', '', '', '', '400.00 - 1500.00', '1992', 'TECHNO COLOR CORPORATION', 'extra_image/No logo.jpg', '<p>Purity : <b>98%</b></p>\r\n<p>Grade : <b>Industrial Grade</b></p>\r\n<p>Type : <b>Other, Acid Yellow 158.1</b></p>\r\n<p>Usage : <b>Textile Dye stuffs </b></p>\r\n<p>Physical Form : <b>Powder</b></p>', '', '', '', 0, 'Mr Atul Sanghavi', 'exporter', '50 Kilograms', 'Hdpe Bag', 'Long Life', 'Powder', '', '2024-09-10', 19, 45, 163, 86, '', 'NO', '24AAAFT0905F1ZR', '', 'NO', 'Maharashtra', 'C1B-35 &amp; 34, Phase 1, G.I.D.C., Mumbai, Maharashtra, 400071, India', '<p>At TECHNO COLOR CORPORATION, we specialize in offering a wide range of high-quality dyes to meet diverse industrial and commercial needs. Our products are designed to deliver vibrant and lasting colour for various applications. </p>\r\n<p>Explore our product offerings:</p>\r\n<p>Acid Dyes, Solvent Dyes, Solvent Soluble Dyes, Acid Metal Complex Dyes, Acid Moderate Dyes, Non Benzidine Direct Dyes etc.</p>', 'India', 'INR / Kilograms', '0'),
(206, 'Agricultural Pesticides', '', 'extra_image/Agricultural Pesticide.jpg', '', '', '', 'Get Latest Price', '2008', 'REDOX INDUSTRIES LIMITED', 'extra_image/redox-logo.jpg', '<p>Accepts only Domestic inquiries</p>\r\n<p>Classification : <b>Biological Pesticide</b></p>\r\n<p>Release Type : <b>Controlled</b></p>\r\n<p>Application : <b>Agriculture, Pest Control</b></p>\r\n<p>Type : <b>Insecticide</b></p>', '', '', '', 0, 'Ms RENUKA A TRAPASIYA', 'exporter', '10 Bottle', 'Bottle', '1-2 Years', 'Agriculture', '', '2024-09-10', 10, 46, 166, 88, '', 'NO', '24AADCR9406M1Z3', '', 'NO', 'Gujarat', 'B-411, Signature-2, Opp. Relief Hotel, Sarkhej-Sanad Road, Sarkhej, Ahmedabad, Gujarat, 382210, India', '<p>At REDOX INDUSTRIES LIMITED, we are dedicated to providing innovative and high-quality solutions for agricultural success. </p>\r\n<p>Our product range includes:</p>\r\n<p>Organic Fungicides, Amino Acids, Flowering Stimulant, Organic Pesticides, Plant Growth Regulators, Seaweed Extracts, etc.</p>', 'India', '', '0'),
(208, 'Organic Pesticide', '', 'extra_image/Agricultural Pesti.jpg', '', '', '', '3059.00', '2011', 'HEXA AGRO INDUSTRIES', 'extra_image/hexa-agro-logo.jpg', '<p>Classification : <b>Biological Pesticide</b></p>\r\n<p>Release Type : <b>Controlled</b></p>\r\n<p>Purity(%) : <b>98% 99% 100%</b></p>\r\n<p>Application : <b>Agriculture</b></p>\r\n<p>Type : <b>Other</b></p>', '', '', '', 0, 'Ms. Gazala', 'Manufacturer', '10 Pieces', 'Bottle', '2-3 Years', 'Biological Pesticide', '', '2024-09-10', 10, 46, 167, 88, '', 'NO', '24AGAPT4788L1ZS', '', 'NO', 'Gujarat', 'B-402, Signature-2 Building, Sarkhej-Sanand Cross Road, Sarkhej, Ahmedabad, Gujarat, 382210, India', '<p>At HEXA AGRO INDUSTRIES, we are dedicated to providing high-quality, environmentally-friendly solutions for pest control. Our range of organic pesticides is designed to ensure optimal crop protection while supporting sustainable agricultural practices. </p>\r\n<p>Explore our product offerings:</p>\r\n<p>High-quality Fly Out Organic Pesticide, Hulk Organic Pesticide, Kill Bill Organic Pesticide, etc.</p>', 'India', 'INR / Liter', '0'),
(211, 'Copper Sulphate', '', 'extra_image/Copper Sulph.jpg.crdownload', '', '', '', '190', '2019', 'RAJ METACHEM', 'extra_image/raj-metachem-logo.jpg', '<p>Ph Level : <b>3</b></p>\r\n<p>Solubility : <b>98</b></p>\r\n<p>Storage : <b>Room Temperature</b></p>\r\n<p>Place of Origin : <b>India</b></p>\r\n<p>Application : <b>Fertilizer</b></p>', '', '', '', 0, 'Mr Raj Prajapati', 'Manufacturer', '100 Kilograms', 'Packets', 'Long Life', 'Fertilizer', '', '2024-09-10', 10, 46, 168, 89, '', 'NO', '24DGFPP8213N1Z0', '', 'NO', 'Gujarat', 'Plot No : C-1, 41/2, GIDC Estate, Kalol, Gujarat, 382725, India', '<p>At RAJ METACHEM, we are dedicated to providing high-quality inorganic chemicals and agricultural products that meet the diverse needs of our clients. Our commitment to excellence ensures that you receive reliable products that drive success in your industry.</p>\r\n<p>Our Product Range:</p>\r\n<p>Inorganic Chemicals: Our comprehensive range of inorganic chemicals is designed to support various industrial applications. From manufacturing to research, our chemicals meet the highest standards of purity and performance</p>.\r\n<p>Agricultural Products: Enhance your agricultural practices with our range of premium products. We offer solutions that support plant growth, improve soil health, and boost overall crop yield.</p>', 'India', 'INR / Kilograms', '0'),
(212, ' Sulphur Powder ', '', 'product-image/sulphurpowder.jpg', '', '', '', '210.00 - 400.00', '2002', 'CMS INDUSTRIES', 'extra_image/cms-logo.jpg', '<p>Accepts only Foreign inquiries</p>\r\n<p>Form : <b>Powder</b></p>\r\n<p>Molecular Weight : <b>32.065 Grams (g)</b></p>\r\n<p>Melting Point : <b>112-120 AdegC</b></p>\r\n<p>Density : <b>1.9-2.1 Gram per millilitre (g/mL)</b></p>\r\n<p>Chemical Name : <b>Sulphur</b></p>\r\n<p>Ph Level : <b>4 -5</b></p>', '', '', '', 0, 'Mr Chintan Sejpal', 'exporter', '25 Metric Ton', 'Bag', 'Long Life', 'Powder', '', '2024-09-10', 10, 46, 169, 89, '', 'NO', '24BDKPS7263P1ZO', '', 'NO', 'Gujarat', 'C-9, 1st Floor, Opp. VBC Samajwadi, Bhuj, Gujarat, 370001, India', '<p>At CMS INDUSTRIES, we specialize in delivering high-quality, value-added grades of Bentonite to meet a wide range of industrial and commercial needs. Our commitment to excellence ensures that our Bentonite products offer superior performance and reliability for your applications.</p>\r\n</b>Our Product Offerings:</p>\r\n</b>Value-Added Bentonite Grades: We provide an extensive range of Bentonite grades, each engineered to deliver exceptional quality and tailored to specific applications. Our Bentonite products are designed to meet the highest industry standards and enhance performance across various uses.</p>', 'India', 'USD / Metric Ton', 'not-active'),
(213, 'Imported Jacquard Fabric', '', 'product-image/fabric.jpg', '', '', '', '400', '5', 'RUZAIN AL WAFI IMPEX LLP', 'extra_image/ruzain.png', 'we are delighted to present our exquisite range of abaya fabrics, designed to offer both elegance and comfort.', '', '', '', 0, 'Mr. GS Mastaan Ali', 'exporter', '6000', 'Pieces', 'Long Shelf Life', 'Premium', '', '2024-09-10', 11, 48, 173, 91, '', 'NO', 'NO', '', 'NO', 'Gujarat', 'Plot no 55 A, Al Habib Greens, Behind Ever Green Hotel, Narol, Ahmedabad, Gujarat, India - 382405', 'Luxurious Materials: Our abaya fabrics are sourced from the finest materials, including rich silks, soft chiffons, and durable crepes. Each fabric is chosen for its superior quality, ensuring a luxurious feel and a graceful drape.', 'India', 'meter', 'not-active'),
(215, 'Rice Husk', '', 'extra_image/husk.jpg', '', '', '', 'Get Latest Price', '1994', 'Nova Industries', 'extra_image/No logo.jpg', '<p>Use :  <b>Industrial</b></p> \r\n<p>Variety : <b>Nutrition feeds</b></p>\r\n<p>Colour : <b>white</b></p>\r\n<p>Moisture : <b>1%</b></p>\r\n<p>Purity : <b>99%</b></p>', '', '', '', 0, 'Mr. Umesh Chandra', 'Manufacturer', '10 Kilograms', 'Bag', '1-2 Years', '99% Pure', '', '2024-09-10', 10, 49, 175, 92, '', 'NO', '09AABFN4757E1Z8', '', 'NO', 'Uttar Pradesh', 'Puranpur, Pilibhit Road, Pilibhit, Uttar Pradesh, 262122, India', '<p>At Nova Industries, we specialize in providing top-grade materials designed to meet the demands of various industrial applications.</p>\r\n<p>Our flagship product is:</p>\r\n<p>99% Purity Rice Husk Ash: Our high-quality rice husk ash, with 99% purity, is ideal for industrial use. It’s perfect for applications such as cement production, concrete reinforcement, and as an additive in various manufacturing processes. Our rice husk ash is processed to ensure exceptional purity and performance.</p>', 'India', '', '0'),
(216, 'Eco-Friendly Coir Fiber', '', 'extra_image/fiber.jpg', '', '', '', 'Get Latest Price', '2012', 'ROOTS AGRO EXPORTERS', 'extra_image/No logo.jpg', '<p>Accepts only Foreign inquiries</p>\r\n<p>Physical Form : <b>Plain</b></p>\r\n<p>Colour : <b>Light Brown</b></p>\r\n<p>Moisture (%) : <b>Nil</b></p>\r\n<p>Feature : <b>Eco-Friendly</b></p>\r\n<p>Payment Terms : <b>Cash on Delivery (COD)</b></p>', '', '', '', 0, 'Mr. Mithun Chakkara Varthy', 'exporter', '100 Kilograms', 'Plastic Bag', 'Long Life', 'Eco-Friendly', '', '2024-09-10', 10, 49, 176, 93, '', 'NO', '33ACKPU8710F1ZH', '', 'NO', 'Tamil Nadu', '2/1A3, K.Nagoor, Kanchampatti Post, Pollachi, Tamil Nadu, 642003, India', '<p>At ROOTS AGRO EXPORTERS, we are committed to providing premium coco peat products that cater to the needs of growers and gardeners around the world. Our high-quality coco peat offerings are designed to enhance soil health and boost plant growth, ensuring your green projects thrive.</p>\r\n<p>Our Product Range</p>\r\n<p>Coco Peat Briquettes, Coco Peat Block, Coco Peat Grow Bags, Coco Peat Disc, etc.</p>', 'India', '', '0'),
