(341, 'Metal High Efficiency Electrical Mini Auto Fuse', '', 'extra_image/Metal High Efficiency Electrical Mini Auto Fuse.jpg', '', '', '', '4', '2012', 'Fuse Tech India', 'extra_image/No logo.jpg', '<p>Resistance : <b>Shock, Heat</b></p>\r\n<p>Power Source : <b>Electrical</b></p>\r\n<p>Application : <b>Electrical</b></p>\r\n<p>Efficiency : <b>High Efficiency</b></p>\r\n<p>Attributes : <b>Easy to Install, Lightweight</b></p>', '', '', '', 0, 'MR. Hira Lal Kalra', 'supplier', '5000 Pieces', 'Box', 'Long Shelf Life', 'High Efficiency', '', '2024-09-20', 12, 23, 294, 51, '', 'NO', 'NO', '', 'NO', 'Delhi', '305, Vardhman Center, BH Block, East Shalimar Bagh, Delhi, Delhi, 110088, India', '<p>At Fuse Tech India, we specialize in providing high-quality mini auto fuses designed to protect your automotive electrical systems. Our commitment to excellence and innovation ensures that our products meet the highest industry standards, offering reliability and safety for all your vehicle needs.</p>\r\n', 'India', 'INR / Piece', '0'),
