(345, 'Stop Light Switches', '', 'extra_image/Stop Light Switches.jpg', '', '', '', '25.00', '1996', 'SANTECH ENTERPRISES', 'extra_image/No logo.jpg', '<p>Size : <b>Different Sizes Available</b></p>\r\n<p>Colour : <b>Multicolour</b></p>\r\n<p>Material : <b>Metal</b></p>\r\n<p>Used For : <b>Automobile</b></p>', '', '', '', 0, 'Mr Sanjeev Grover', 'exporter', '10 Unit', 'Box', 'Long Shelf Life', 'Durable', '', '2024-09-20', 12, 23, 296, 124, '', 'NO', '07AAAPG1812A1ZP', '', 'NO', 'Delhi', 'Z-6, Street No-4, Anand Parbat Industrial Area, New Delhi, Delhi, 110005, India', '<p>At Santech Enterprises, we are committed to bringing you the latest and most innovative electric and electronic gadgets designed to enhance your everyday life. With a focus on quality, performance, and user satisfaction, we provide a diverse range of products that meet the needs of consumers and businesses alike.</p>\r\n', 'India', 'INR / Unit', '0'),
