(537, 'Natural Chamomile Flower', '', 'extra_image/Natural Chamomile Flower.jpg', '', '', '', 'Get Latest Price', '2007', 'Bonville Organic International', 'extra_image/bonville-organic-international.jpg', '<p>Condition : <b>Fresh</b></p>\r\n<p>Quality : <b>Good</b></p>\r\n<p>Storage : <b>Cool and dry place</b></p>\r\n<p>Purity : <b>100%</b></p>\r\n<p>Natural : <b>100%</b></p>\r\n<p>Type : <b>Dried Flowers</b></p>\r\n<p>Part : <b>Flower</b></p>', '', '', '', 0, 'Mr Raja S S', 'exporter', '100 Kilograms', 'Plastic Bag', '1 year', '100% Pure and Natural', '', '2024-10-05', 10, 10, 489, 13, '', 'NO', '33AAMFB4097L1Z2', '', 'NO', 'Tamil Nadu', 'Saibaba Colony, Coimbatore, Tamil Nadu, 641035, India', '<p>At Bonville Organic International, we specialize in high-quality, organic products that promote health and well-being. Our commitment to purity ensures that you receive the finest natural offerings.</p>\r\n<p>Our Products</p>\r\n<p> High-quality 100% Natural Chamomile Flower, Dried Lemon Hibiscus Tea, etc.</p>', 'India', '', '0'),
