(540, 'Tomato Plant', '', 'extra_image/Tomato.jpg', '', '', '', 'Get Latest Price', '2021', 'Sanket', 'extra_image/No logo.jpg', '<p>Product Type : <b>Plant</b></p>\r\n<p>Soil Specific : <b>Alkaline</b></p>\r\n<p>Type : <b>Fresh</b></p>\r\n<p>Colour : <b>Green</b></p>\r\n<p>Height : <b>4 - 5 Inch</b></p>\r\n<p>Feature : <b>Pesticide Free</b></p>', '', '', '', 0, 'Sanket Sharad Pund', 'Manufacturer', '100 Pieces', 'Box', '5-7 Days', 'Fresh', '', '2024-10-07', 10, 10, 493, 20, '', 'NO', 'NO', '', 'NO', 'Maharashtra', 'null Malegaon, Maharashtra, 422303, India', '<p>At Sanket, we take pride in offering high-quality, pesticide-free tomato plants that are perfect for your garden. Our plants are carefully nurtured to ensure robust growth and delicious, flavourful tomatoes.</p>\r\n', 'India', '', '0'),
(541, 'Green Desert Cactus Plant', '', 'extra_image/Green Desert Cactus Plant.jpg', '', '', '', '70', '2018', 'Shrikant Nursare', 'extra_image/No logo.jpg', '<p>Type : <b>Plant</b></p>\r\n<p>Variety : <b>Other, Cactus</b></p>\r\n<p>Colour : <b>Green</b></p>\r\n<p>Surface Finishing : <b>Gloss Finished, Matt Finished</b></p>\r\n<p>Soil Specific : <b>Acidic, Alkaline</b></p>\r\n<p>Other Necessities : <b>Well Watered, Slow Growth, Full Sun Exposure</b></p>', '', '', '', 0, 'Mr Shrikant', 'supplier', '20 Pieces', 'Box', 'Long Life', 'Green', '', '2024-10-07', 10, 10, 494, 20, '', 'NO', 'NO', '', 'NO', 'Maharashtra', 'Dr.No.10, Gulf Association Society, Opp MA School, Near HP Petro Pump, SV Road, Andheri West, Mumbai, Maharashtra, 400058, India', '<p>Welcome to Shrikant Nursary, your go-to destination for a diverse range of vibrant plants.</p>\r\n<p>Our collection includes:</p>\r\n<p>Desert Cactus Plant , Natural Green Garden Plant, Scarlet Sage, etc.</p>', 'India', 'INR', '0'),
(542, 'Moringa Dried Leaves Powder', '', 'extra_image/Moringa Dried Leaves Powder.jpg', '', '', '', '210', '2005', 'Narayan Trading Company', 'extra_image/No logo.jpg', '<p>Product Type : <b>Organic Product</b></p>\r\n<p>Category : <b>Herbs & Herbs Extract</b></p>\r\n<p>Usage : <b>As an ingredient in herbal/botanical/ayurvedic products.</b></p>\r\n<p>Ingredients : <b>Herbal Extract</b></p>\r\n<p>Form : <b>Powder</b></p>\r\n<p>Grade : <b>A</b></p>', '', '', '', 0, 'Mr. Jitendra Tiwari', 'supplier', '200 Kilograms', 'Plastic Bag', '2-3 Years', 'Organic', '', '2024-10-07', 10, 10, 495, 131, '', 'NO', '08DBOPM8482C1Z6', '', 'NO', 'Rajasthan', 'SAINTHALROAD, DURGA MANDIR KE SAMNE, Dausa, Rajasthan, 303303, India', '<p>At Narayan Trading Company, we offer a range of high-quality, natural health and body care products designed to enhance your wellness routine. </p>\r\n<p>Our selection includes:</p>\r\n<p> Amino Acids Vitamins Enzymes Standard Body Care Aloe Vera Gel For Sanitizer, Anti-Oxidant Rich Anti-Inflammatory Moringa Dried Leaves Powder, Antioxidant Antibacterial Body Care Standard Gel Organic Green Aloe Vera, etc.</p>', 'India', 'INR / Kilograms', '0'),
(543, 'Green Dehydrated Mint Leaves', '', 'extra_image/Green Dehydrated Mint Leaves.jpg', '', '', '', 'Get Latest Price', '2021', 'Satvik Farms and Global Exporter', 'extra_image/No logo.jpg', '<p>Physical Form : <b>Leaf</b></p>\r\n<p>Product Name : <b>Dehydrated Mint Leaves</b></p>\r\n<p>Product Type : <b>Dried</b></p>\r\n<p>Colour : <b>Green</b></p>\r\n<p>Taste : <b>Natural</b></p>\r\n<p>Drying Process : <b>Sun Dry</b></p>\r\n<p>Flavour : <b>Rich</b></p>\r\n<p>Use : <b>Cooking, Human Consumption</b></p>', '', '', '', 0, 'Mr. Dhiraj Rajendra Deokar', 'exporter', '25 Kilograms', 'Plastic Bag', 'Upto 12 Months', 'Dried and Natural', '', '2024-10-07', 10, 10, 496, 131, '', 'NO', 'NO', '', 'NO', 'Maharashtra', 'Karmaveer Nagar Indira Path, Kopargaon, Maharashtra, 423601 , India', '<p>At Satvik Farms and Global Exporter, we take pride in providing high-quality, natural spices and seasonings that enhance your culinary creations.</p>\r\n<p>Our premium products include:</p>\r\n<p>Quality Aromatic Odour Natural Taste Healthy Dried Brown Cumin Powder, Dried Natural Rich Taste Healthy FSSAI Certified Dehydrated Garlic Powder, Dried Rich Natural Taste Dehydrated Red Onion Powder, etc.</p>', 'India', '', '0'),
