(546, 'Stainless Steel Reaper And Binder', '', 'extra_image/Stainless Steel Reaper And Binder.jpg', '', '', '', '2000-2600', '2014', 'Weifang Binhai Group Work Win Supply Chain Co., Ltd.', 'extra_image/weifang-binhai-group-work-win-supply-chain-co-ltd.jpg', '<p>Power Source : <b>Diesel</b></p>\r\n<p>Start Method : <b>Electric Start</b></p>\r\n<p>Material : <b>Stainless Steel</b></p>\r\n<p>Weight : <b>2000-3000 kg</b></p>\r\n<p>Driven Type : <b>Hydraulic</b></p>\r\n<p>Condition : <b>New</b></p>\r\n<p>Automatic Grade : <b>Fully Automatic</b></p>', '', '', '', 0, 'Ms Daisy Yan', 'exporter', '1 Piece', 'Unpacked', 'Long Shelf Life', 'Premium', '', '2024-10-07', 10, 11, 499, 25, '', 'NO', 'NO', '', 'NO', '', 'Binhai Chuangye Building, Binhai Economic and Technological Development Zone, Weifang, Shandong, 262737, China', '<p>At Weifang Binhai Group, we are dedicated to providing the best agricultural and garden equipment to meet the evolving needs of farmers and gardeners around the world. With our extensive product range, we empower you to achieve maximum efficiency and productivity in your agricultural endeavours.</p>\r\n', 'China', 'USD', '0'),
