(548, 'Mini Harvester For Agriculture', '', 'extra_image/Mini Harvester For Agriculture.jpg', '', '', '', 'Get Latest Price', '2020', 'JASPO INDUSTRIES PRIVATE LIMITED', 'extra_image/No logo.jpg', '<p>Product Type : <b>Mini Harvester</b></p>\r\n<p>General Use : <b>Harvesting</b></p>\r\n<p>Type : <b>Combine Harvester</b></p>\r\n<p>Power : <b>45 Horsepower (HP)</b></p>\r\n<p>Power Source : <b>Diesel</b></p>\r\n<p>Voltage : <b>240 V</b></p>\r\n<p>Frequency : <b>60 Hz</b></p>\r\n<p>Material : <b>Mild Steel</b></p>', '', '', '', 0, 'Mr. Jaspal Singh', 'Manufacturer', '1 Piece', 'Unpacked', 'Long Shelf Life', 'Mild Steel', '', '2024-10-07', 10, 11, 501, 25, '', 'NO', '03AAECJ8705G1ZR', '', 'NO', 'Punjab', '542-A, Bhagta Bhai Ka Urban, Rampura Phul, Bathinda, Punjab, 151206, India', '<p>At JASPO INDUSTRIES, we are dedicated to providing high-quality agricultural machinery designed to enhance productivity and efficiency for farmers. Our innovative mini harvesters are engineered to meet the demands of modern agriculture, helping you achieve a successful harvest with ease.</p>\r\n', 'India', '', '0');
