(669, 'B Complex Softgel', '', 'extra_image/1756124645-Supplements-SS-Post.jpg', '', '', '', '1,450.00 - 1,560.00', '2017', 'Curivo Healthcare', 'extra_image/12585-comp-image.png', '<table class=\"table\" cellpadding=\"5\" cellspacing=\"0\"><tbody><tr><td>&nbsp;Business Type</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Manufacturer, Exporter, Supplier</td></tr><tr><td>&nbsp;Country of Origin</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;India</td></tr><tr><td>&nbsp;Shelf Life</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 18 months</td></tr></tbody></table>', '', '', '', 0, 'Mr. Shilen Aggarwal', 'exporter', '50000 Piece (MOQ)', 'Box', '18 months', 'Certification : WHO-cGMP', '', '2025-08-25', 25, 60, 621, 162, '', 'NO', '07AAMFC3486C1ZG', '', 'NO', 'Delhi', '357, Aggarwal Metro Heights, Netaji Subhash Place (NSP), Pitampura, Delhi - 110034, India', '<h5>About Curivo Healthcare</h5><p><strong data-start=\\\"208\\\" data-end=\\\"229\\\">Curivo Healthcare</strong> is a prominent name in the pharmaceutical industry, offering an extensive portfolio of <strong data-start=\\\"317\\\" data-end=\\\"362\\\">Pharmaceutical, Nutraceutical, and Herbal</strong> formulations. We specialize in providing high-quality solutions in <strong data-start=\\\"430\\\" data-end=\\\"474\\\">Gynaecology, Orthopaedics, and Neurology</strong>, serving both domestic and international markets.</p><h5>Leading Pharma Company in Delhi</h5><div><p data-start=\\\"567\\\" data-end=\\\"748\\\">Headquartered in Delhi, Curivo Healthcare has established itself as a <strong data-start=\\\"637\\\" data-end=\\\"671\\\">leading pharmaceutical company</strong> with a broad spectrum of products that cater to various medical specialties.</p><p data-start=\\\"790\\\" data-end=\\\"1106\\\">Curivo Healthcare has built a solid presence across <strong data-start=\\\"842\\\" data-end=\\\"860\\\">global markets</strong>, delivering top-tier <strong data-start=\\\"882\\\" data-end=\\\"947\\\">Pharmaceutical, Nutraceutical, Ayurvedic, and Herbal products</strong>. Our modern manufacturing infrastructure is outfitted with advanced machinery and supported by a team of qualified professionals committed to our core values.</p><p data-start=\\\"1108\\\" data-end=\\\"1253\\\">We ensure stringent <strong data-start=\\\"1128\\\" data-end=\\\"1183\\\">multi-level quality control and assurance processes</strong>, making every product a reliable solution for better health outcomes.</p><p data-start=\\\"567\\\" data-end=\\\"748\\\">\r\n\r\n</p><p data-start=\\\"1255\\\" data-end=\\\"1622\\\">Thanks to our dedicated <strong data-start=\\\"1279\\\" data-end=\\\"1306\\\">regulatory affairs team</strong>, Curivo has successfully entered multiple international markets, including <strong data-start=\\\"1382\\\" data-end=\\\"1401\\\">regulated zones</strong>. Our products are currently being exported—directly and through partners—to over <strong data-start=\\\"1483\\\" data-end=\\\"1499\\\">30 countries</strong>, such as the <strong data-start=\\\"1513\\\" data-end=\\\"1607\\\">USA, UK, Philippines, Bolivia, Venezuela, Kyrgyzstan, Yemen, Myanmar, Nepal, and Sri Lanka</strong>, among others.</p><h3 data-start=\\\"2005\\\" data-end=\\\"2039\\\"><strong data-start=\\\"2009\\\" data-end=\\\"2039\\\">Manufacturing Capabilities</strong></h3><p data-start=\\\"2041\\\" data-end=\\\"2109\\\">Curivo Healthcare operates through two advanced manufacturing units:</p><h4 data-start=\\\"2111\\\" data-end=\\\"2178\\\"><strong data-start=\\\"2116\\\" data-end=\\\"2176\\\">Unit-1: Indo Rama Engineers (Kala Amb, Himachal Pradesh)</strong></h4><ul data-start=\\\"2179\\\" data-end=\\\"2374\\\">\r\n<li data-start=\\\"2179\\\" data-end=\\\"2218\\\">\r\n<p data-start=\\\"2181\\\" data-end=\\\"2218\\\">Specializes in <strong data-start=\\\"2196\\\" data-end=\\\"2216\\\">Softgel Capsules</strong></p>\r\n</li>\r\n<li data-start=\\\"2219\\\" data-end=\\\"2266\\\">\r\n<p data-start=\\\"2221\\\" data-end=\\\"2266\\\">Manufactures <strong data-start=\\\"2234\\\" data-end=\\\"2264\\\">General and Hormonal drugs</strong></p>\r\n</li>\r\n<li data-start=\\\"2267\\\" data-end=\\\"2320\\\">\r\n<p data-start=\\\"2269\\\" data-end=\\\"2320\\\">Produces <strong data-start=\\\"2278\\\" data-end=\\\"2318\\\">Nutraceutical and Health Supplements</strong></p>\r\n</li>\r\n<li data-start=\\\"2321\\\" data-end=\\\"2374\\\">\r\n<p data-start=\\\"2323\\\" data-end=\\\"2374\\\"><strong data-start=\\\"2323\\\" data-end=\\\"2365\\\">USFDA-compliant and WHO-cGMP certified</strong> facility</p>\r\n</li>\r\n</ul><h4 data-start=\\\"2376\\\" data-end=\\\"2449\\\"><strong data-start=\\\"2381\\\" data-end=\\\"2447\\\">Unit-2: Indorama Health Care Pvt. Ltd. (Yamuna Nagar, Haryana)</strong></h4><ul data-start=\\\"2450\\\" data-end=\\\"2651\\\">\r\n<li data-start=\\\"2450\\\" data-end=\\\"2534\\\">\r\n<p data-start=\\\"2452\\\" data-end=\\\"2534\\\">Produces <strong data-start=\\\"2461\\\" data-end=\\\"2479\\\">Non-Betalactam</strong> forms: Capsules, Tablets, Oral Liquids, Oral Powders</p>\r\n</li>\r\n<li data-start=\\\"2535\\\" data-end=\\\"2577\\\">\r\n<p data-start=\\\"2537\\\" data-end=\\\"2577\\\">Also specializes in <strong data-start=\\\"2557\\\" data-end=\\\"2575\\\">Nutraceuticals</strong></p>\r\n</li>\r\n<li data-start=\\\"2578\\\" data-end=\\\"2651\\\">\r\n<p data-start=\\\"2580\\\" data-end=\\\"2651\\\">Recognized by multiple <strong data-start=\\\"2603\\\" data-end=\\\"2629\\\">regulatory authorities</strong> and <strong data-start=\\\"2634\\\" data-end=\\\"2651\\\">GMP certified</strong></p>\r\n</li>\r\n</ul><hr data-start=\\\"2653\\\" data-end=\\\"2656\\\"><h3 data-start=\\\"2658\\\" data-end=\\\"2685\\\"><strong data-start=\\\"2662\\\" data-end=\\\"2685\\\">Company Information</strong></h3><p data-start=\\\"1255\\\" data-end=\\\"1622\\\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><ul data-start=\\\"2687\\\" data-end=\\\"2930\\\">\r\n<li data-start=\\\"2687\\\" data-end=\\\"2733\\\">\r\n<p data-start=\\\"2689\\\" data-end=\\\"2733\\\"><strong data-start=\\\"2689\\\" data-end=\\\"2710\\\">Managing Director</strong>: Mr. Shilen Aggarwal</p>\r\n</li>\r\n<li data-start=\\\"2734\\\" data-end=\\\"2759\\\">\r\n<p data-start=\\\"2736\\\" data-end=\\\"2759\\\"><strong data-start=\\\"2736\\\" data-end=\\\"2751\\\">Established</strong>: 2017</p>\r\n</li>\r\n<li data-start=\\\"2760\\\" data-end=\\\"2816\\\">\r\n<p data-start=\\\"2762\\\" data-end=\\\"2816\\\"><strong data-start=\\\"2762\\\" data-end=\\\"2779\\\">Business Type</strong>: Manufacturer, Exporter &amp; Supplier</p>\r\n</li>\r\n<li data-start=\\\"2817\\\" data-end=\\\"2848\\\">\r\n<p data-start=\\\"2819\\\" data-end=\\\"2848\\\"><strong data-start=\\\"2819\\\" data-end=\\\"2832\\\">Team Size</strong>: 10 Employees</p>\r\n</li>\r\n<li data-start=\\\"2849\\\" data-end=\\\"2896\\\">\r\n<p data-start=\\\"2851\\\" data-end=\\\"2896\\\"><strong data-start=\\\"2851\\\" data-end=\\\"2867\\\">Global Reach</strong>: Serving clients worldwide</p>\r\n</li>\r\n<li data-start=\\\"2897\\\" data-end=\\\"2930\\\">\r\n<p data-start=\\\"2899\\\" data-end=\\\"2930\\\"><strong data-start=\\\"2899\\\" data-end=\\\"2913\\\">GST Number</strong>: 07AAMFC3486C1ZG</p></li></ul></div>', 'India', 'INR / Piece', '0');
